import React from 'react';
import { createRoot } from 'react-dom/client';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import GateEntryPage from './components/GateEntryPage';
import Step1 from './components/Step1';
import Step2 from './components/Step2';
import reportWebVitals from './reportWebVitals';
import './components/App.css';

const root = createRoot(document.getElementById('root'));
root.render(
  <Router>
    <Switch>
      <Route path="/gate-entry" component={GateEntryPage} />
      <Route path="/step1" component={Step1} />
      <Route path="/step2" component={Step2} />
      <Route path="/" component={DefaultComponent} />
    </Switch>
  </Router>
);

const DefaultComponent = () => {
  return (
    <div>
      <h1>Default Component</h1>
      {/* You can render any default content here */}
    </div>
  );
};

export default DefaultComponent; // Export DefaultComponent as default
